import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createDrawerNavigator } from '@react-navigation/drawer';

export default function Menu()
{

  const Drawer = createDrawerNavigator();

  return(
    <NavigationContainer>
      <Drawer.Navigator initialRouteName="App" drawerStyle={styles.drawerNav}>
        <DrawerScreen name="App" Text="Primeira Tela" />
        <Drawer.Screen name="App" component={App} />
        <Drawer.Screen name="MeuApp" component={AppTwo} />
      </Drawer.Navigator>
    </NavigationContainer>
  )
}

export function App() {

  return (
    <View style={styles.container}>
      <Text>Open up App.js to start working on your app!</Text>
      <StatusBar style="auto" />
    </View>
  );
}

export function AppTwo() {

  const drawer = createDrawerNavigator();

  return (
    <View style={styles.container}>
      <Text>I see you're already working on your app!</Text>
      <StatusBar style="auto" />
    </View>
  );
}

function DrawerScreen(props)
{
  return <Drawer.Screen
    name={props.name}
    component={App}
    options={
      {
        drawerLabel: (({focused}) => <Text style={{ color: focused ? '#313131' : '#fff' }}>{props.Text}</Text>),
        drawerIcon: (({focused}) => <Icon style={focused ? '#313131' : '#fff' } name="home " />),
      }
    }
    />
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  drawerNav: {
    backgroundColor: "#313131",
    paddingVertical: 20
  },
});
